import React from "react";
import { useState } from "react";

import '../styles/Map.css'
import SideCard from "../components/sideCard";


export default function Map() {
  
  const places = [
    { id: 0, name : 'Lab de bio', className: 'bio', img: 'assets/undraw_medical-research_pze7.svg' },
    { id: 1, name : 'Usinagem', className: 'usinagem', img: 'assets/undraw_maker-launch_fwzi.svg'},
    { id: 2, name : 'Cozinha', className: 'cozinha', img: 'assets/undraw_chef_d0ht.svg' },
    { id: 3, name : 'Academia', className: 'gym', img: 'assets/undraw_personal-trainer_bqkg.svg' },
  ]   
  
   const [state, setState] = useState(null)

  
  return(
  <>
   <section id="mapa">
   <div className="mapSection">
      <div className="map">
        <img src="assets/mapasempontos.png" class="map" alt=""/>

         
         {places.map((place) => (
            <div key={place.id} className={`${place.className} pinpoint`} onClick={() => {setState(place.id)}} >
              <h1>{place.name}</h1>
              <img src="assets/pin verde.png"  alt=""/>
            </div>



         ))
         
         } 
         
         
      </div>
     


      <SideCard places={places} Id={state}/>

    </div>
    </section>
  
  </>
  
  )


}
